import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const App = () => {
  const [health, setHealth] = useState('');
  const [example, setExample] = useState('');

  useEffect(() => {
    fetch('/api/health')
      .then(res => res.json())
      .then(data => setHealth(data.message));

    fetch('/api/example')
      .then(res => res.json())
      .then(data => setExample(data.example));
  }, []);

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center justify-center p-5">
      <h1 className="text-4xl font-bold text-center mb-6">Keystone Creator Suite</h1>
      <div className="bg-white shadow rounded p-6 w-full max-w-xl text-center">
        <p className="text-xl mb-4"><strong>Backend Health:</strong> {health}</p>
        <p className="text-lg"><strong>Example API:</strong> {example}</p>
      </div>
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
